This is the video premiere of the Danish psych-rock band @ring_them_bells newest single 'Favorite Gun', filmed in the basement at @warpigs_brewpub_cph, where a dark substance related to the music is resting in the barrels 🤘

@ring_them_bells will be taking over mikkellerbeer on Thursday, 20:00 CET and release some evil and crazy (acoustic) sounds.  They will play simultaneously at our Virtual Bar in Bobs Hytte - limited seating and smoking inside is allowed.

@mikkellermikkel about the collaboration: I love Ring Them Bells because of the noise and their fuck-you-attitude, which hides a lot of  nuances, melody and poetry under the surface That's why it's fun brewing a beer for them and their music. The beer will be black and heavy 🖤
